import React from 'react';
import { useNavigation } from '@react-navigation/native';
import './App.css';

function App() {
  const navigation = useNavigation();

  function handleNavigate(page) {
    navigation.navigate(page);
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1>Aplikacija za lov</h1>
        <div className="Menu">
          <Button text="EVIDENCIJA LOVACA" onPress={() => handleNavigate('EvidencijaLovaca')} />
          <Button text="RASPORED AKTIVNOSTI I LOVA" onPress={() => handleNavigate('RasporedAktivnosti')} />
          <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" onPress={() => handleNavigate('EvidencijaPrisutnosti')} />
          <Button text="UNOS DIVLJAČI" onPress={() => handleNavigate('UnosDivljaci')} />
          <Button text="UNOS ODSTRIJELENE DIVLJAČI" onPress={() => handleNavigate('UnosOdstreljeneDivljaci')} />
          <Button text="BODOVI" onPress={() => handleNavigate('Bodovi')} />
        </div>
      </header>
    </div>
  );
}

function Button({ text, onPress }) {
  return (
    <button className="Button" onClick={onPress}>
      {text}
    </button>
  );
}

export default App;
